import React, { Component } from 'react'

export default class App extends Component {
  state = {
    count: 0
  }


  render() {
    return (
      <div>
        <h1>Count :{this.state.count} </h1>
        <button onClick={()=>{
          this.setState((prev)=>{
            return{
              count:prev.count+1
            }
          },()=>{
            console.log('Clicked .....',this.state.count)
          })
        }}>Increament</button>
        <button onClick={()=>{this.setState((prev)=>{
          return{count:prev.count-1}
        },()=>{
          console.log('Clicked .....',this.state.count)
        })}}>Decreament</button>
      </div>
    )
  }
}
